import './App.css';
import React, { useState } from 'react';
import MainPage from "./Page/MainPage"
import FirstPage from "./Page/FirstPage"
import SecondPage from "./Page/SecondPage"
import { BrowserRouter, Link, Route, Routes, Switch } from 'react-router-dom';

function App() 
{
  let setPage = ["Main", "First", "Second"]

  return(
    <BrowserRouter>
      <div className="App">
        <div className="Page-Header">

          <Link to={`/${setPage[0]}`}>
              <button type="button"> {setPage[0]} </button>
          </Link>

          <Link to={`/${setPage[1]}`}>
              <button type="button"> {setPage[1]} </button>
          </Link>

          <Link to={`/${setPage[2]}`}>
              <button type="button"> {setPage[2]} </button>
          </Link>
        </div>


        <Routes>
          <Route exact path={`/${setPage[1]}`} element={<MainPage/>} /> 
          <Route path="/First" element={<FirstPage/>} /> 
          <Route path="/Second" element={<SecondPage/>} /> 
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
